import React from 'react';
import logo from './logo.svg';
import './App.css';
import './css/style.css';
import CreateResourceForm from './components/CreateResourceForm';
import ContentComponent from './components/ContentComponent';

function App() {
  const handleResourceCreated = (resource) => {
    console.log('Resource created:', resource);
    // Additional logic to handle the created resource
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      {/* Adding the CreateResourceForm component below the header */}
      <CreateResourceForm onResourceCreated={handleResourceCreated} />
      {/* Including the ContentComponent that handles data fetching and display */}
      <ContentComponent />
    </div>
  );
}

export default App;
